var pagejax=function(e,ref){var sectionName="recentload";var goToSectionClassName="go-to-recentloaded";$("#"+sectionName).remove();$(ref).append('<span id="'+sectionName+'" class="clip-always" tabindex="-1">Recently loaded results:</span>');if(!$("."+goToSectionClassName)[0]){$(e.target).after('<a class="'+goToSectionClassName+' clip " href="#'+sectionName+'">Move to loaded results.</a>')}}